// src/translatePlugin.js
export default {
  install(Vue) {
    Vue.prototype.$translate = {
      setLanguage(lang) {
        // eslint-disable-next-line no-undef
        translate.language.setLocal(lang);
      },
      useService(service) {
        // eslint-disable-next-line no-undef
        translate.service.use(service);
      },
      execute() {
        // eslint-disable-next-line no-undef
        translate.execute();
      }
    };
  }
};
